#include "lcHead.h"
bool ht[256];
bool noDoubleChar(char *s, int lens, int *d)
{
    memset(ht, 0, sizeof(ht));

    for (int i = 0; i < lens; i++) {
        if (ht[s[i]])  {
            *d = i;
            return false;
        } else {
            ht[s[i]] = 1;
        }
    }
    *d = lens;
    return true;
}

int lengthOfLongestSubstring(char * s)
{
	int strlens = strlen(s);
	int maxLen = 0;

	for (int j = 0; j < strlens; j++) {
		int t;
		noDoubleChar(&s[j], strlens - j, &t);
		if (t > maxLen)
			maxLen = t;
	}

	return maxLen;
};

